import React from "react";
import { Link, NavLink } from "react-router-dom";

import styles from "./NavBar.module.css";

const NavBar = () => {
  return (
    <div>
      <header className={styles.navbar}>
        <nav>
          <ul>
            <li>
              <NavLink
                to="/page-one"
                className={(navData) => (navData.isActive ? styles.active : "")}
              >
                Home
              </NavLink>
            </li>
            <li>
              <NavLink
                to="/page-two"
                className={(navData) => (navData.isActive ? styles.active : "")}
              >
                Destination
              </NavLink>
            </li>
            <li>
              <NavLink
                to="/page-three"
                className={(navData) => (navData.isActive ? styles.active : "")}
              >
                Image
              </NavLink>
            </li>
          </ul>
        </nav>
      </header>
    </div>
  );
};

export default NavBar;
